SELECT (COUNT(?goldMedal) as ?goldMedals)
WHERE {
  ?phelps dbpedia-owl:goldMedal ?goldMedal;
          dbpedia-owl:olympics dbpedia:2008_Summer_Olympics.
}
GROUP BY ?phelps
FILTER(?phelps = dbpedia:Michael_Phelps)

