  FILTER NOT EXISTS { ?player dbo:birthDate ?otherBirthDate;
                              dbo:team dbr:Premier_League;
                              dbo:birthDate ?birthDate.
                      FILTER(?birthDate = ?otherBirthDate)
                    }
}
ORDER BY ?birthDate
LIMIT 1

